import { Button } from '@/components/ui/button';
import { Input } from '@/components/ui/input';
import { Select, SelectContent, SelectItem, SelectTrigger, SelectValue } from '@/components/ui/select';

const books = ref([
  { id: 1, title: 'Book 1', author: 'Author 1', category: 'Category 1' },
  { id: 2, title: 'Book 2', author: 'Author 2', category: 'Category 2' },
]);

const newBook = ref({ title: '', author: '', category: '' });

const addBook = () => {
  books.value.push({ ...newBook.value, id: books.value.length + 1 });
  newBook.value = { title: '', author: '', category: '' };
};

const deleteBook = (id) => {
  books.value = books.value.filter((book) => book.id !== id);
};

const updateBook = (id, field, value) => {
  const index = books.value.findIndex((book) => book.id === id);
  books.value[index][field] = value;
};
